import React from "react";
import { useDispatch, useSelector } from "react-redux";
import { getApi } from "../counter/counterSlice";

export const Api = () => {
  const dispatch = useDispatch();
  const { loading, data } = useSelector((state) => state);
  // console.log(dispatch(getApi()));
  // console.log(data);
  // dispatch(getApi())

  return (
    <div>
      <h1>Api</h1>
      <button onClick={() => dispatch(getApi())}>Click me</button>
      <table
        border="2px"
        align="center"
        cellPadding={"12px"}
        cellspacing={"0px"}
      >
        <tr>
          <th>Id</th>
          <th>Title</th>
          <th>Action</th>
        </tr>
        {loading ? (
          <div>loading....</div>
        ) : (
          data.map((item) => {
            return (
              <tr>
                <td>{item.id}</td>
                <td>{item.title}</td>
                <td>
                  <button>Delete</button> <button>Edit</button>
                </td>
              </tr>
            );
          })
        )}
      </table>
    </div>
  );
};
